import React , { Component } from 'react';
import { Input ,Button} from 'antd';



class Todolist extends Component{
    render(){
        return 
        <div>
        <Input placeholder="Basic usage" />
        <Button type="primary">Primary Button</Button>
        </div>
    }
}

export default Todolist;
